import numpy as np
import matplotlib.pyplot as plt
from matplotlib.ticker import MultipleLocator
from matplotlib.colors import LinearSegmentedColormap
from matplotlib.transforms import Bbox
import math

# Create custom color map. We want to be able to distinguish small multiplicities well,
# but not cycle through the colormap so often for big multiplicities
viridis = plt.get_cmap('viridis')
def custom_mapping(x):
    const = 0.1
    if x < const:
        return x / const
    elif x < 2.0*const:
        return (3.0*const - x) / (2.0*const)
    else:
        return (1.0 - x) / (2.0*(1.0 - 2.0*const))
x_vals = np.linspace(0, 1, 256)
colors = viridis([custom_mapping(x) for x in x_vals])
custom_cmap = LinearSegmentedColormap.from_list("viridis_custom", colors)

