dataset_items = list(datasets.items())
total_num = len(dataset_items) // 2

# Loop over datasets, matching U_1- and U_2-slopes
for fig_num in range(0, total_num):
    # Get the current chunk (2 datasets)
    chunk = [dataset_items[fig_num], dataset_items[fig_num + total_num]]
    
    # Create subplots for this chunk
    fig, axes = plt.subplots(1, 2, figsize=(24, 10))
    
    for ax, ((q, t, i), data) in zip(axes, chunk):
        # Unpack data
        x_vals, y_vals, m_vals = zip(*data)
                
        # Need to consider type q-1 instead of 0 for some calculations
        n = t if t>0 else q-1
        
        # Constant C for upper bound as described in the article
        if q == 2:
            C = 4
        else:
            if n == 1:
                C = 2*q+1+(q-3)*(q+2) + 3 
            else:
                C = 2*q+1+(n-2)*(q+2) 
        
        # Add slope shift correction, since the normalization changed between 
        # computing the slopes and writing the article. 
        # The slope infinity is placed at (3-i)*(-5).
        y_vals = [y - (3.0-i)*(n-1.0) if y>=0 else (3.0-i)*-5 for y in y_vals]
        
        # Convert multiplicities to NumPy Array so we can take their squareroots as 
        # the radius of our plot points
        m = np.array(m_vals)
        
        # Scatter plot on the current Axes
        sc = ax.scatter(
            x_vals, y_vals,
            s=np.sqrt(m)*10, # Multiplicity is encoded in both size...
            c=m_vals, # ... and color, with our custom color map
            cmap=custom_cmap, alpha=0.7, edgecolor='k',
            label='all slopes'
        )
        
        # Add colorbar to current Axes
        plt.colorbar(sc, ax=ax, label='Multiplicity')
        
        
        # Create custom labels for y-axis to mark the slope infinity
        current_ticks = ax.get_yticks()
        new_ticks = [t for t in current_ticks if t >= 0] + [(3.0-i)*-5]
        new_ticks = sorted(new_ticks)
        new_labels = ['\u221e' if t == (3.0-i)*-5 else str(t) for t in new_ticks]
        ax.set_yticks(new_ticks)
        ax.set_yticklabels(new_labels)
        plt.draw()  # Important! Ensures ticklabel text objects are created
        # Enlarge fontsize of the slope infinity's label
        for tick, label in zip(ax.get_yticks(), ax.get_yticklabels()):
            if tick == (3.0-i)*-5:
                label.set_fontsize(16)

        # Add newform slopes, upper bound, legend, etc.
        ax.plot(x_vals, [(3.0 - i) / 3.0 * (k - 3.0*(n-1.0)) for k in x_vals], 'rx', label='newform slope')
        ax.plot([k for k in x_vals if k-C >= 0], [k-C if i == 2 else 2*(k-C) for k in x_vals if k-C >= 0], label=f"suggested upper bound k-{C}")
        ax.set_title(f"$q={q}$, type=${t}$, $i={i}$")
        ax.set_xlabel("Weight $k$")
        ax.set_ylabel("Slope")
        ax.grid(True)
        lgnd = ax.legend()
        
        # Adjust scatter plot marker size manually 
        lgnd.legendHandles[0]._sizes = [30]

    # Finish and save
    plt.tight_layout()
    fig.suptitle("Slopes for $U_1$ and $U_2$", fontsize=16, y=1.05)
    plt.savefig(f"plot_q{q}type{t}.png", bbox_inches='tight')
    plt.close(fig) 
